import React from "react";
import { Doughnut } from "react-chartjs-2";
import { Chart as ChartJS, ArcElement, Tooltip, Legend } from "chart.js";

ChartJS.register(ArcElement, Tooltip, Legend);

const DoubleDoughnutChart = () => {
  const data = {
    labels: ["A", "B", "C", "D", "E", "F", "G", "H", "I", "J"],
    datasets: [
      {
        label: "Inner Data",
        data: [30, 10, 15, 45],
        backgroundColor: ["#732fff", "#0020b0", "#00b4b0", "#338fff"],
        borderWidth: 2,
        hoverOffset: 4,
        circumference: 180,
        rotation: 270,
        cutout: "50%",
      },
      {
        label: "Outer Data",
        data: [10, 10, 10, 10, 10, 10, 10, 10, 10, 10],
        backgroundColor: [
          "#00b4b0",
          "#338fff",
          "#ec63ff",
          "#732fff",
          "#0020b0",
          "#00b4b0",
          "#338fff",
          "#ec63ff",
          "#732fff",
          "#0020b0",
        ],
        borderWidth: 2,
        hoverOffset: 4,
        cutout: "80%",
      },
    ],
  };

  const options = {
    responsive: true,
    cutoutPercentage: 80,
    plugins: {
      legend: {
        position: "top",
      },
    },
  };

  return (
    <div style={{ position: "relative", width: "300px", height: "300px" }}>
      <Doughnut data={data} options={options} />
    </div>
  );
};

export default DoubleDoughnutChart;
